import Layout from '../src/components/Layout';
import { Cookies } from 'react-cookie';

//components
import Button from '../src/components/Buttom'

const cookies = new Cookies();

const dashboard = () => {
    return (
        <Layout>

            <style global jsx>{`
                *{
                    box-sizing: border-box;
                }
                html,
                body,
                body > div:first-child,
                div#__next,
                div#__next > div,
                div#__next > div > div {
                    height: 100%;
                    margin:0; padding:0;
                }

                .row-1{
                    width: 100%;
                    height: 5%;
                    margin: 0;
                    padding: 0;
                }
                .row-2{
                    width: 100%;
                    height: 95%;
                    margin: 0;
                    padding: 0;
                }
                .colm{
                    width: 100%;
                }

                .fila{
                    border: solid 1px;
                    padding: 0;
                }

                .col-style{
                    float: right; 
                    border: 1px solid;                       
                }
            `}</style>
        </Layout>
    );
}

export default dashboard;
